import './App.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import OnePost from "./components/OnePost";
import React from "react";
import HomePageComponent from './components/HomePageComponent';
import { Container, Tab, Tabs, Link } from '@material-ui/core';

function App() {

  return (
    <Container>

    <Tabs
      value={'value'}
      indicatorColor="primary"
      textColor="primary"
      centered
      >
        <BrowserRouter>
      <Tab component={Route} to="/" label="Home"/>
      <Tab component={Route} to="/:slug" label="SinglePage" />
        <Switch>
          <Route component={HomePageComponent} path="/" exact />
          <Route component={OnePost} path="/:slug" />
        </Switch>
      </BrowserRouter>
      </Tabs>
    </Container>
  );
}

export default App;
